import React, {Component} from 'react';
import {LoginWrapper, LoginArea, HeaderText} from './style';
import {connect} from 'react-redux';
import {Link} from 'react-router-dom';

class Login extends Component{
	render() {
		return (
			<LoginWrapper>
				<Link to='/' className='backHome'><img className='logoImg' src='/images/login.png' alt='logo' />
				</Link>
				<LoginArea>
					<HeaderText><span className='loginText'>登录</span><span>·</span><span>注册</span></HeaderText>
					<div><span className='iconfont'>&#xe663;</span><input placeholder='手机号或邮箱' /></div>
					<div><span className='iconfont'>&#xe640;</span><input placeholder='密码' type="password"/></div>
					<button>登录</button>
				</LoginArea>
			</LoginWrapper>
		)
	}

}

const mapState = (state) => {
	return {
	}
}
const mapDispatch = (dispatch) => {
	return {
		
	}
}

export default connect(mapState, mapDispatch)(Login);
